import React from 'react';
import { Link } from 'react-router-dom';

const OrderTracking = () => {
    // Sample order status data
    const orderStatus = [
        { id: 1, status: 'Order Placed', time: '12:00 PM' },
        { id: 2, status: 'Preparing', time: '12:15 PM' },
        { id: 3, status: 'On the Way', time: '12:45 PM' },
        { id: 4, status: 'Delivered', time: '1:15 PM' }
    ];

    return (
        <div className="container py-5" style={{ backgroundColor: '#e0f7df', minHeight: '100vh' }}>
            <div className="card bg-transparent border-0">
                <div className="card-body">
                    <h1 className="text-center display-4 mb-4 text-black">Order Tracking</h1>
                    <ul className="list-group">
                        {orderStatus.map((status) => (
                            <li
                                key={status.id}
                                className="list-group-item d-flex justify-content-between align-items-center bg-light"
                            >
                                <span className="fw-bold">{status.status}</span>
                                <span className="badge bg-success rounded-pill">{status.time}</span>
                            </li>
                        ))}
                    </ul>
                    <div className="d-flex justify-content-center mt-4">
                        <Link to="/" className="btn btn-outline-light">Back to Home</Link>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default OrderTracking;
